وَالَّذِينَ آمَنُوا وَاتَّبَعَتْهُمْ ذُرِّيَّتُهُمْ بِإِيمَانٍ أَلْحَقْنَا بِهِمْ ذُرِّيَّتَهُمْ وَمَا أَلَتْنَاهُمْ مِنْ عَمَلِهِمْ مِنْ شَيْءٍ ۚ كُلُّ امْرِئٍ بِمَا كَسَبَ رَهِينٌ
كسانى كه خود ايمان آوردند و فرزندانشان در ايمان، پيرويشان كردند. فرزندانشان را به آنها ملحق مى‌كنيم و از پاداش عملشان هيچ نمى‌كاهيم كه هر كسى در گرو كار خويشتن است.
..... .
و كساني كه ايمان آوردند و اولاد ايشان به تبع آنها قبول اسلام نمودند اگر چه اعتقاد آنها كامل نباشد و عملشان كمتر از پدرانشان باشد صغير باشند يا كبير، خداوند باحترام پدرانشان و براى خشنودى آنها ذريّه و نسل آنانرا ملحق بايشان فرموده هم درجه آنها در بهشت قرار ميدهد و در مقابل اين كرامت چيزى از پاداش اعمال آنها كاسته نمي فرمايد بلكه صرف تفضّل است. از امام صادق ع و در حديث نبوى اين معنى نقل شده و از چند روايت معتبر استفاده مي شود كه اطفال اهل ايمان در بهشت تحت تربيت حضرت ابراهيم و ساره قرار مي گيرند و از درخت مخصوصى تغذّى مي نمايند و روز قيامت ملبّس و معطّر بپدرانشان هديه داده مي شوند و اين روايات در ذيل اين آيه و در تفسير آن وارد شده است و فرد اكمل اين الحاق تبعيّت ذريّه طاهره پيغمبر صلى اللّه عليه و آله و سلّم و امير المؤمنين عليه السّلام است در درجات آن دو و در بعضى از روايات به اين معنى اشاره و بكمتر نبودن ائمه اطهار از امير المؤمنين عليه السّلام در حجيّت قول و اطاعت امر بنصّ پيغمبر ص تصريح شده است و پس از اين براى آنكه فرزندان مغرور بعمل پدران خود نشوند مي فرمايد هر كس در گرو عمل خود ميباشد اگر عملش خوب شد آزاد ميگردد و اگر عملش بد شد هلاك مي شود بلى اگر عمل پسر خوب و عمل پدر خوبتر باشد براى كرامت پدر پسر را با او محشور خواهند نمود. 
