اللھم صل على محمد و آل محمد 
اللهم ارحم موتانا وموتى المسلمين واشفي مرضانا ومرضى المسلمين. اللهم اغفر للمسلمين والمسلمات والمؤمنين والمؤمنات الأحياء منهم والأموات
اللهم لا تدع لنا ذنبا إلا غفرته، ولا هما إلا فرجته، ولا عيبا إلا أصلحته، ولا حاجة لنا من حوائج الدنيا والآخرة لك فيها رضى ولنا فيها صلاح إلا يسرتها وقضيتها برحمتك يا أرحم الراحمين
اشھد ان لا اله الا اللّه وحده لا شريك له
